// File: contracts/711/FeeApprover.sol

// SPDX-License-Identifier: MIT

pragma solidity ^0.5.16;






contract FeeApprover is Ownable, ADDRESSBOOK {
    using SafeMath for uint256;

    constructor() public {
        _711TokenAddress = TOKEN_ADDRESS_711;
        stakingRewardsAddress = STAKING_CONTRACT;
        tokenUniswapPair = UNISWAP_V2_PAIR_711_WETH;
        vaultAddress = VAULT;
        contractCreation = now;
        setZapper(ZAP);
    }

    address tokenUniswapPair;
    address _711TokenAddress;
    address vaultAddress;
    address stakingRewardsAddress;
    address zapperAddress;
    uint256 constant public feePercentX100 = 5; // 5% transfer fee
    uint256 constant public bootstrappingPeriod = 7 days;
    uint256 public lastTotalSupplyOfLPTokens;
    uint256 public contractCreation;


    function setZapper(address _zapper) public onlyOwner {
        zapperAddress = _zapper;
    }

    function bootstrappingFinished() public view returns (bool) {
        return now > contractCreation.add(bootstrappingPeriod);
    }

    function sync() public {
        uint256 _LPSupplyOfPairTotal = IERC20(tokenUniswapPair).totalSupply();
        lastTotalSupplyOfLPTokens = _LPSupplyOfPairTotal;
    }

    function calculateAmountsAfterFee(        
        address sender,
        address recipient,
        uint256 amount
        ) public  returns (uint256 transferToAmount, uint256 transferToFeeDistributorAmount) 
        {
            require(msg.sender == _711TokenAddress, "Nuh uh uh");
            if(sender == tokenUniswapPair) {
                require(recipient == zapperAddress || bootstrappingFinished(), "Only allowed ZapIn duing bootstrapping");
            }

            uint256 _LPSupplyOfPairTotal = IERC20(tokenUniswapPair).totalSupply();

            console.log("sender is " , sender);
            console.log("recipient is is " , recipient, 'pair is :', tokenUniswapPair);

            console.log("Old LP supply", lastTotalSupplyOfLPTokens);
            console.log("Current LP supply", _LPSupplyOfPairTotal);
            
            console.log('Sender is pair' , sender == tokenUniswapPair);
            console.log('lastTotalSupplyOfLPTokens <= _LPSupplyOfPairTotal' , lastTotalSupplyOfLPTokens <= _LPSupplyOfPairTotal);

            /// Situations that dont charge fee:
            /// 1) Withdrawing from vault
            /// 2) Sending out as rewards from staking contract
            /// 3) Notifying rewards to staking contract by distributor
            /// 4) Sending out from uniswapPair (buying)
            /// 5) Single side zap in
            if(sender == vaultAddress
                || sender == stakingRewardsAddress
                || sender == REWARDS_DISTRIBUTOR
                || sender == tokenUniswapPair
                || (sender == zapperAddress && recipient == tokenUniswapPair)
                ) {
                console.log("Sending without fee");
                transferToFeeDistributorAmount = 0;
                transferToAmount = amount;
            }
            else {
                console.log("Normal fee transfer");
                transferToFeeDistributorAmount = amount.mul(feePercentX100).div(100);
                transferToAmount = amount.sub(transferToFeeDistributorAmount);
            }

           lastTotalSupplyOfLPTokens = _LPSupplyOfPairTotal;
        }
}
